  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Pathfinder National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1963.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments. A progress report on field investigations and applied research
  is also provided. Resource management is outlined; topics include grazing. The public
  relations section of the report describes recreational uses. N-R forms and photographs
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
